import React from "react";
import "./homepage.css";
import { ReactComponent as HelloIcon } from "../icons/hello.svg";
import Nav from "./Nav";

export default function Homepage() {
  return (
    <div>
      <Nav></Nav>
      <div class="container">
        <h1>
          Hello I'm Ankur.
          <br /> I'm full a stack developer.
        </h1>
        <div class="curtain"></div>
        <div class="image-container">
          <HelloIcon />
        </div>
      </div>
    </div>
  );
}
